const pageData = (slug: string) => {
  const country = simCardCountryData.find((i: country) => i.slug === slug);

  return country
    ? {
        seo: seo({ ...country }),
        hero: hero({ ...country }),
        sections: sections({ ...country }),
      }
    : null;
};

export default pageData;
